const Cart = ({cart,setcart}) => {
    return ( 
        <div className="cart">
            {cart.map((data)=>(
                <div className="carty">
                    <br /><br /><br /><br /><br /><br /><br /><br /><br /><br />
                    <h1>{data.title}</h1>
                </div>
            ))}
        </div>
     );
}
 
export default Cart;
